import React from "react";
import SimpleCard from "./components/Cards/Cards";
import "./App.css";

const Style = {
  color: "blue",
};

function App() {
  return (
    <div className="container-1">
      <div className="box-1">
        <SimpleCard style={Style} text="Confirmed" />
      </div>
      <div className="box-2">
        <SimpleCard text="Recovered " />
      </div>
      <div className="box-2">
        <SimpleCard text="Deaths" />
      </div>
    </div>
  );
}

export default App;
